import React from 'react';
import Table from 'react-bootstrap/Table';
import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';

function LeagueAdminPage({ data }) {
    return (
        <Tabs
        defaultActiveKey="teams"
        id="admin-tabs"
        className="mb-3"
      >
        <Tab eventKey="player" title="Players">
          <PlayersTable data={data}>
        </PlayersTable>
        </Tab>
        <Tab eventKey="team" title="Teams">
          <TeamsTable data={data}>
        </TeamsTable>
        </Tab>
      </Tabs>
    );
  }

function TeamsTable({data}){
    return(
        <div>
        <h2>Teams</h2>
        <Table striped bordered hover responsive size="sm">
          <thead>
            <tr>
              <th>Team Name</th>
              <th>Team Size</th>
              <th>League Admin</th>
            </tr>
          </thead>
          <tbody>
            {data?.teams?.map((team, index) => (
              <tr key={index}>
                <td>{team.team_name}</td>
                <td>{team.team_size}</td>
                <td>{team.league_admin}</td>
              </tr>
            ))}
          </tbody>
        </Table>
      </div>
    );
}

function PlayersTable({data}){
    return (
    <div>
        <h2>Players</h2>
        <Table striped bordered hover responsive size="sm">
          <thead>
            <tr>
              <th>Name</th>
              <th>Average Score</th>
              <th>Games Participated</th>
              <th>Team</th>
            </tr>
          </thead>
          <tbody>
            {data?.players?.map((player, index) => (
              <tr key={index}>
                <td>{player.name}</td>
                <td>{player.average_score}</td>
                <td>{player.games_participated}</td>
                <td>{player.team}</td>
              </tr>
            ))}
          </tbody>
        </Table>
      </div>
    );
}




export default LeagueAdminPage;
